import {BrowserRouter, Route} from 'react-router-dom';
import Signup from './Signup';
import CakeList from './CakeLIst';
function NewApp() {
    return (
        <div>
            <BrowserRouter>
                <Navbar/>
                <Route path="/" component={CakeList}></Route>
                <Route path="/signup" component={Signup}></Route>
            </BrowserRouter>
        </div>

    )
}

export default NewApp;
